import React from 'react';
import styled from "styled-components";

const Wrapper = styled.div`
	width: 1200px;
	margin: 0 auto;

	.button {
		text-align: center;
		margin: 80px 0;
	}
`;

const Main = (props) => {
  return <>
    <h1>독서모임 요약</h1>
    <h1>우리 독서 모임은 ...</h1>
  </>;
};

export default Main;
